import React from "react";
import ReactDOM from "react-dom";
import Card from "./Cards";
import './index.css';
import Sdata from "./Sdata";


ReactDOM.render(
  <>
  <h1 className="heading_style"> List Of Top 5 Netflix Series in 2020</h1>
  <Card 
     imgsrc={Sdata[0].imgsrc}
     sname={Sdata[0].sname}
     title={Sdata[0].title}
     link={Sdata[0].link} 
   />
  <Card 
    imgsrc="https://picsum.photos/268/300"
    sname="Stranger Things"
    title="A Netflix Orignal Series"
    link="https://www.primevideo.com/?ref_=dvm_pds_cpb_in_as_s_b_d122E_mkw_b2670bMZ-dc&mrntrk=pcrid_76278741750105_slid__pgrid_1220457968499500_pgeo_148996_x__ptid_kwd-76278668764561:loc-90" 
  />
  </>,
document.getElementById("root")
);
